    currentJoke: '', currentAnswer: ''}
  }
  handleShowJoke = () => {

    alert("button clicked");

  }
  render(){
    return(
    <div className="App">
        <h1> Jokes App </h1>
      <Button onClick={this.handleShowJoke} style={{marginTop: '80px', marginRight: '10px'}} variant="outline-primary">tell joke!</Button>
    </div>
    );
  }
}

export default App;
